import React from 'react';
import { useHistory } from 'react-router-dom'
let history = useHistory();
function Details(props) {
    return (
        <div>
                <button onClick={() =>{history.goBack()}} >이전으로</button>
                <div>아이디</div>
                <div>제목</div>
                <div>내용</div>
        </div>
    );
}

export default Details;
